{
  "$schema": "http://json-schema.org/draft-04/schema",
  "type": "object",
  "additionalProperties": false,
  "patternProperties": {
	   "#management":{} 
	   },
  "required": [
    "ArchiveUnitProfile","DescriptionLevel","Title_"
  ],
  "definitions": {
    "pattern-simple-date": {
      "type": "string",
      "pattern": "[0-9]{4}-[0-9]{2}-[0-9]{2}"
    },
    "pattern-date": {
      "type": "string",
      "pattern": "^([0-8][0-9]{3}-(0[1-9]|1[0-2])-(0[1-9]|[12][0-9]|3[01]))$"
    }
  },
  "properties": {
    "ArchiveUnitProfile": {
      "type": "string",
      "description": "Identifiant du PUA : cardinalité 1"
    },
    "DescriptionLevel": {
      "type": "string",
      "description": "Niveau de description : cardinalité 1"
    },
    "Title": {
      "type": "object",
      "description": "Titre de la ressource Create : cardinalité 1-N"
    }
  }
}
